DROP TABLE IF EXISTS `wind_user`;
CREATE TABLE `wind_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `login_name` varchar(50) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '用户姓名',
  `sex` tinyint(3) NOT NULL DEFAULT '1' COMMENT '性别 1 男 2女',
  `password` varchar(255) NOT NULL DEFAULT '' COMMENT '密码',
  `mobile` char(11) NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(50) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '用户邮箱',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `realname` varchar(20) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `role_ids` varchar(50) NOT NULL DEFAULT '' COMMENT '角色id 字符串以逗号相连',
  `is_use` tinyint(2) NOT NULL DEFAULT '1' COMMENT '0 禁用 1 启用',
  `leader` varchar(200) NOT NULL DEFAULT '' COMMENT '上级领导',
  `address` varchar(200) NOT NULL DEFAULT '' COMMENT '地址',
  `dept_id` int(11) NOT NULL DEFAULT '0' COMMENT '部门id',
  `post_id` int(11) NOT NULL DEFAULT '0' COMMENT '职位id',
  `avatar` varchar(200) NOT NULL DEFAULT '' COMMENT '头像地址',
  `last_login_time` datetime NOT NULL COMMENT '最后登录时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

